/* fullScreen */
;(function($){
    $.fn.fullScreen = function(options) {

        //default settings
        var settings = $.extend({
            'width': false,
            'resize': true,
            'maxOnly': false,
            'parent': 'body',
            'minus': 0,
            'reduce': 1
        }, options);

        var element = this;
        var bodyHeight = $(settings.parent).innerHeight();
        var bodyWidth = $(settings.parent).innerWidth();

        // console.log(bodyHeight);

        //width
        if ( settings.width == true ) {
            this.each(function() {
                var $this = $(this);
                $this.css('width', bodyWidth);
            });
            //resize (width)
            if ( settings.resize == true ) {
                $(window).bind('resize', function() {
                    element.each(function() {
                        var $this = $(this);
                        $this.css('width', 'auto');
                        bodyWidth= $(settings.parent).innerWidth();
                        $this.css('width', bodyWidth);
                    });
                });
            }
        }

        //height
        this.each(function() {
            var $this = $(this);
            if ( settings.maxOnly == true ) {
                $this.css('max-height', (bodyHeight-settings.minus)/settings.reduce);
            } else {
                $this.css('height', (bodyHeight-settings.minus)/settings.reduce);
            }
        });

        //resize (height)
        if ( settings.resize == true ) {
            $(window).bind('resize', function() {
                element.each(function() {
                    var $this = $(this);
                    $this.css('height', 'auto');
                    $this.css('max-height', 'auto');
                    bodyHeight = $(settings.parent).innerHeight();

                    if ( settings.maxOnly == true ) {
                        $this.css('max-height', (bodyHeight-settings.minus)/settings.reduce);
                    } else {
                        $this.css('height', (bodyHeight-settings.minus)/settings.reduce);
                    }
                });
            });
        }
    };
})(jQuery);

